ndir_t mdnum9_get_ndir_order(ord_t order, mdnum9_t* num){

  ndir_t res;

  switch(order){
    case 0:
      res = 1;
      break;
    case 1:
      res = 9;
      break;
    case 2:
      res = 36;
      break;
    case 3:
      res = 84;
      break;
    case 4:
      res = 126;
      break;
    case 5:
      res = 126;
      break;
    case 6:
      res = 84;
      break;
    case 7:
      res = 36;
      break;
    case 8:
      res = 9;
      break;
    case 9:
      res = 1;
      break;
  }

  return res;

}

